sse Range, a fim de ordenar os intervalos pelos seus limites inferiores:
Range.prototype.compareTo = function(that) {
    return this.from – that.from;
};
Observe que a subtração feita por esse método retorna corretamente um valor menor do que zero, 
igual a zero ou maior do que zero, de acordo com a ordem relativa dos dois Ranges. Como a enu-
meração Card.Rank no Exemplo 9-8 tem um método valueOf(), poderíamos ter usado esse mesmo 
truque idiomático no método compareTo() da classe Card.
